import React from 'react';
// import './sdkcomp.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit } from '@fortawesome/free-solid-svg-icons';

const SdkComponent = (props) => {
    const { data } = props;
    const { project, industry_domains, funnel_stages, project_role, sdk_type } = data;

    return (
        <div className="w-full min-w-[250px] max-w-[300px] h-full min-h-[150px] max-h-[200px] flex flex-col justify-evenly bg-[lightblue] m-4 p-2 rounded-2xl">
            <div className='text-base'>
                <h1 className='text-[darkblue] self-center'>{project}</h1>
                <FontAwesomeIcon icon={faEdit} className='sdk-project-edit' />
            </div>
            <h1 className='text-[0.8rem] text-[blueviolet]'>{industry_domains}</h1>
            <h1 className='text-[0.8rem] text-[blueviolet]'>{funnel_stages}</h1>
            <div className='flex justify-between'>
                <h1 className='text-base'>{project_role}</h1>
                <a className='self-center text-[maroon] underline'>Download SDK</a>
            </div>
        </div>
    )
}

export default SdkComponent;
